import MyExperience from "../components/Contents/ExperienceContents/MyExperience";
import React from "react";
import FooterTag from "../components/Layout/FooterTag";

const Experience = () => {
  return (
    <React.Fragment>
        <MyExperience />
        <FooterTag />
    </React.Fragment>
  );
};

export default Experience;
